"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["2395"],{70683:function(e){e.exports=JSON.parse('{"name":"Sccache","slug":"sccache","url":"https://app.radicle.xyz/nodes/seed.rhizoma.dev/rad:zzmCBDptFLrfUEHSjcFsLJ2Aghav","description":"A Woodpecker CI plugin that integrates sccache with your CI/CD pipeline","docs":"<h1>plugin-sccache</h1>\\n<p>This plugin allows you to cache the results of your builds using sccache, a distributed compiler cache. It integrates seamlessly with your CI/CD pipeline, ensuring faster builds and reduced compilation times.</p>\\n<h2>Usage</h2>\\n<p>The plugin relies on the <code>sccache</code> binary to manage the caching process. Ensure that <code>sccache</code> is installed and available in your CI/CD environment or use the provided volume in your step with:</p>\\n<pre><code>    volumes:\\n      - sccache:/sccache_data\\n</code></pre>\\n<h2>Features</h2>\\n<ul>\\n<li><strong>Distributed Caching</strong>: Leverage the power of sccache to cache compiled artifacts across multiple machines.</li>\\n<li><strong>Seamless Integration</strong>: Easily integrate sccache into your existing CI/CD workflow without modifying your build scripts.</li>\\n<li><strong>Performance Boost</strong>: Reduce build times by reusing previously compiled artifacts, saving time and resources.</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th align=\\"left\\">Parameter</th>\\n<th align=\\"left\\">Description</th>\\n<th>Default</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td align=\\"left\\"><code>s3-bucket</code></td>\\n<td align=\\"left\\">S3 bucket name</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-endpoint</code></td>\\n<td align=\\"left\\">S3 compatible endpoint URL</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-access-key</code></td>\\n<td align=\\"left\\">S3 access key</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-secret-key</code></td>\\n<td align=\\"left\\">S3 secret key</td>\\n<td></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-key-prefix</code></td>\\n<td align=\\"left\\">S3 bucket key prefix</td>\\n<td><code>sccache</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-region</code></td>\\n<td align=\\"left\\">AWS region</td>\\n<td><code>auto</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-use-ssl</code></td>\\n<td align=\\"left\\">Set to true if the endpoint requires HTTPS/TLS</td>\\n<td><code>true</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-server-side-encryption</code></td>\\n<td align=\\"left\\">Enable server-side encryption with SSE-S3</td>\\n<td><code>true</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>s3-enable-virtual-host</code></td>\\n<td align=\\"left\\">Enable if you are using a custom endpoint that supports virtual host style addressing</td>\\n<td><code>false</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>save-if</code></td>\\n<td align=\\"left\\">Set readonly access to the cache</td>\\n<td><code>true</code></td>\\n</tr>\\n<tr>\\n<td align=\\"left\\"><code>log-level</code></td>\\n<td align=\\"left\\">Sccache log level</td>\\n<td><code>info</code></td>\\n</tr>\\n</tbody></table>\\n","tags":["cache"],"author":"Sebastian Martinez <sebastian@rhizoma.dev>","containerImage":"quay.io/radicle_garden/plugin-sccache","containerImageUrl":"https://quay.io/radicle_garden/plugin-sccache","verified":false}')}}]);